import { Dialog, DialogContent, DialogActions } from '@mui/material';
import { Button } from './ui/button';

interface Props {
    open: boolean;
    onClose: () => void;
    setShowNewRuleForm?: React.Dispatch<React.SetStateAction<boolean>>;
    handleSubmit?: () => void;
    handleUpdate?: () => void;
    handleCancel?: () => void;
}

const RuleAlert = ({ open, onClose, setShowNewRuleForm, handleSubmit, handleUpdate, handleCancel }: Props) => {
    const handleYesClick = () => {
        if (typeof handleSubmit === 'function') {
            handleSubmit();
        }
        if (typeof setShowNewRuleForm === 'function') {
            setShowNewRuleForm(true);
            onClose();
        }
        if (typeof handleUpdate === 'function') {
            handleUpdate();
        }
        if (typeof handleCancel === 'function') {
            handleCancel();
        }
    };

    return (
        <Dialog open={open} onClose={onClose} maxWidth="xs" fullWidth>
            <DialogContent>
                <div className="flex items-center justify-center mt-3">
                    {
                        typeof handleCancel === 'function' ? (
                            <svg width="100" height="100" viewBox="0 0 100 100" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                                <rect width="100" height="100" fill="url(#pattern0_704_1584)" />
                                <defs>
                                    <pattern id="pattern0_704_1584" patternContentUnits="objectBoundingBox" width="1" height="1">
                                        <use xlinkHref="#image0_704_1584" transform="scale(0.00195312)" />
                                    </pattern>
                                    <image id="image0_704_1584" width="512" height="512" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
                                </defs>
                            </svg>

                        ) : (
                            <svg
                                width="100"
                                height="100"
                                viewBox="0 0 100 100"
                                fill="none"
                                xmlns="http://www.w3.org/2000/svg"
                                xmlnsXlink="http://www.w3.org/1999/xlink"
                            >
                                <rect width="100" height="100" fill="url(#pattern0_714_314)" />
                                <defs>
                                    <pattern
                                        id="pattern0_714_314"
                                        patternContentUnits="objectBoundingBox"
                                        width="1"
                                        height="1"
                                    >
                                        <use
                                            xlinkHref="#image0_714_314"
                                            transform="scale(0.00195312)"
                                        />
                                    </pattern>
                                    <image
                                        id="image0_714_314"
                                        width="512"
                                        height="512"
                                        preserveAspectRatio="none"
                                        xlinkHref="data:image/png;base64,"
                                    />
                                </defs>
                            </svg>
                        )
                    }
                </div>
                <p className="w-75 text-center mx-auto mt-4">
                    {typeof handleSubmit === 'function'
                        ? "Are you sure you want to create this rule?"
                        : typeof handleUpdate === 'function'
                            ? "Are you sure you want to edit this rule?"
                            : typeof handleCancel === 'function'
                                ? "Are you sure you want to cancel this rule?"
                                : "Are you sure you want to create a new rule and deactivate old one?"}
                </p>
            </DialogContent>
            <DialogActions style={{ justifyContent: 'center', paddingBottom: '20px', padding: "20px 30px" }}>
                <Button
                    style={{ backgroundColor: '#C72030' }}
                    className="text-white hover:bg-[#C72030]/90 flex-1"
                    onClick={handleYesClick}
                >
                    Yes
                </Button>
                <Button
                    variant="outline"
                    className="flex-1 border-[#C72030] text-[#C72030] hover:bg-[#C72030]/10"
                    onClick={onClose}
                >
                    No
                </Button>
            </DialogActions>
        </Dialog>
    );
};

export default RuleAlert;